INSERT INTO `article` (`idarticle`, `titre`, `date`, `annee`, `mois`, `jour`, `heure`, `contenu`, `image`, `nb_vues`, `vedette`, `publie`, `permalien`, `fk_idmembre`, `fk_idcategorie`, `corrige`, `rapport`, `correcteur`) VALUES
(17, 'Les aventures de Wildstar', '1372870800', '2013', '07', '03', '19:00', '<div class="teaser" style="margin: 0px 0px 30px; padding: 0px; color: rgb(140, 139, 139); font-family: ''Droid Sans'', helvetica, arial, sans-serif; font-size: 14px; line-height: 21px;">Ces derniers mois, nous vous avons fait visiter l&#39;int&eacute;rieur d&#39;un&nbsp;<a class="bbc_url" href="http://youtu.be/6GuvXFD-pXI?t=33m37s" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe">donjon</a>. Nous vous avons ensuite pr&eacute;sent&eacute; les&nbsp;<a class="bbc_url" href="http://www.wildstar-online.com/fr/news/wildstar_wednesday_all_hands_on_deck_for_shiphand_missions.php" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe">missions d&#39;&eacute;quipage</a>, ces petites instances qui s&#39;adaptent &agrave; la taille de votre groupe et vous proposent de d&eacute;couvrir un contenu digne des meilleures &oelig;uvres de science-fiction. Et vous avez s&ucirc;rement une id&eacute;e assez pr&eacute;cise de ce que sont les Raids, avec leurs histoires aussi &eacute;piques qu&#39;incroyables. N&#39;est-ce pas ?</div>\r\n\r\n<p><strong>Aventures et donjons</strong><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Nous vous avons demand&eacute; sur&nbsp;</span><a class="bbc_url" href="https://twitter.com/wildstar_FR" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none; font-family: ''Droid Sans'', helvetica, arial, sans-serif; font-size: 14px; line-height: 21px;" title="Lien externe">Twitter</a><span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">&nbsp;si vous aviez des questions &agrave; nous poser sur les Aventures et celles qui sont revenues le plus souvent portaient sur la diff&eacute;rence entre les Aventures et les donjons.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Un donjon est un environnement lin&eacute;aire, b&acirc;ti autour de diff&eacute;rents m&eacute;canismes de combat et d&#39;affrontements face &agrave; des boss acharn&eacute;s, avec de belles r&eacute;compenses &agrave; la clef. Les donjons reprennent l&#39;histoire du jeu et peuvent m&ecirc;me n&eacute;cessiter toute une vari&eacute;t&eacute; de strat&eacute;gies et tactiques, mais, au final, ils servent surtout &agrave; vous proposer des combats, d&#39;autres combats et toujours plus de combats !</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Contrairement aux donjons qui se d&eacute;roulent dans le &quot;monde r&eacute;el&quot; de Nexus, les Aventures sont des environnements virtuels cr&eacute;&eacute;s par le Gardien. Elles se d&eacute;roulent dans de vastes zones ouvertes et vous permettent de suivre le sc&eacute;nario comme bon vous semble, tout en d&eacute;couvrant des m&eacute;canismes que vous ne trouverez pas au cours de votre progression dans le jeu principal. S&#39;ils ne manquent pas &agrave; l&#39;appel, les combats ne sont pas non plus au c&oelig;ur des Aventures. De fait, nous essayons de les rendre inhabituels et surprenants. Au lieu d&#39;un boss &eacute;pique, vous aurez peut-&ecirc;tre &agrave; repousser des hordes de prisonniers exil&eacute;s ou &agrave; utiliser un jetpack pour d&eacute;truire un dirigeable de guerre du Dominion.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Vous serez r&eacute;compens&eacute;s pour vos efforts par du butin aussi vaste que vari&eacute;, comprenant de l&#39;&eacute;quipement, des objets de d&eacute;co, des recettes et bien plus encore. L&#39;&eacute;quipement obtenu lors d&#39;une Aventure en mode normal vous sera donc des plus utiles pour gagner des niveaux, mais sachez &eacute;galement que le mat&eacute;riel re&ccedil;u en mode v&eacute;t&eacute;ran vous &eacute;quipera m&ecirc;me pour les Raids !</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Suite aux commentaires des b&ecirc;ta-testeurs, nous sommes en train de modifier la fa&ccedil;on dont ces r&eacute;compenses sont d&eacute;cern&eacute;es. Auparavant, le joueur obtenait un nombre limit&eacute; d&#39;objets &agrave; la fin de chaque Aventure et devait ensuite acheter des r&eacute;compenses suppl&eacute;mentaires aupr&egrave;s d&#39;un marchand sp&eacute;cifique. Mais ce syst&egrave;me n&#39;&eacute;tait pas aussi int&eacute;ressant que nous le souhaitions et nous avons donc supprim&eacute; ce marchand et ajout&eacute; plus de r&eacute;compenses au cours de l&#39;Aventure.</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_mal.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_mal.jpg" /></a></p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Combien d&#39;Aventures compte le jeu ?</strong><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Vous pourrez vous lancer dans une Aventure d&egrave;s le niveau 15 pour les Exil&eacute;s comme pour le Dominion. Lors de leur premi&egrave;re Aventure, L&#39;insurrection de Hautecr&ecirc;te, les Exil&eacute;s se rendront sur Auroria pour y rallier le bon peuple contre leur oppresseur du Dominion. Dans L&#39;&Eacute;meute sid&eacute;rale, les joueurs du Dominion seront envoy&eacute;s incognito dans la prison de l&#39;Astrobagne pour y r&eacute;primer une r&eacute;volte qui pourrait bien se transformer en v&eacute;ritable massacre.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Apr&egrave;s ces Aventures d&#39;introduction, les joueurs des deux factions pourront se lancer dans la Guerre sauvage au niveau 25, Le si&egrave;ge du Refuge de la temp&ecirc;te au niveau 30, les Mafieux de Valblanc au niveau 40 et, finalement, La piste de Maltombe au niveau 45. Et comme il s&#39;agit de simulations contr&ocirc;l&eacute;es par le Gardien, vous pourrez y rejouer &agrave; l&#39;envi, pour d&eacute;couvrir &agrave; chaque fois de nouveaux rebondissements et autres butins renversants.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Une fois au niveau 50, vous pourrez rejouer &agrave; ces aventures en mode&nbsp;</span><strong>v&eacute;t&eacute;ran</strong><span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">&nbsp;et aux Aventures de l&#39;autre faction qui vous seront d&eacute;sormais ouvertes. Comme son nom l&#39;indique, ce mode est d&eacute;conseill&eacute; aux &acirc;mes sensibles, mais les r&eacute;compenses n&#39;en seront que plus belles !</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_white.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_white.jpg" /></a></p>\r\n\r\n<p><br />\r\n<strong>Et si je vous disais... que vous &ecirc;tes dans un ordinateur ?</strong><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Les aventures se d&eacute;roulent dans le SIMplex, l&#39;un des nombreux environnements eldans simul&eacute;s, g&eacute;r&eacute;s par le Gardien. IA des plus sophistiqu&eacute;es, le Gardien a &eacute;t&eacute; con&ccedil;u pour aider les Eldans &agrave; mener diff&eacute;rentes exp&eacute;riences et &eacute;tudes sur Nexus.</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_care.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_care.jpg" /></a></p>\r\n\r\n<p><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Comme tout se d&eacute;roule dans le cadre d&#39;une simulation, nous pouvons vous faire revenir dans des zones d&eacute;j&agrave; parcourues ou vous envoyer en terrain inconnu pour y vivre des exp&eacute;riences d&eacute;jant&eacute;es que vous ne trouverez pas dans le jeu principal !</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Ainsi, les joueurs Exil&eacute;s qui connaissent bien le Septentrion sauvage, l&#39;une des premi&egrave;res zones qu&#39;ils d&eacute;couvrent sur Nexus, se retrouveront dans ces montagnes enneig&eacute;es lors de la Guerre sauvage pour y affronter une &eacute;quipe de &quot;champions&quot; PNJ dans un affrontement de type ar&egrave;ne MOBA, sbires skeechs et moodies inclus ! Ils devront capturer et d&eacute;fendre des points de contr&ocirc;le dispers&eacute;s &agrave; travers le Septentrion sauvage pour g&eacute;n&eacute;rer plus de sbires, vaincre des monstres neutres pour acqu&eacute;rir des bonus et d&eacute;truire la base ennemie pour remporter la victoire. Et &agrave; chaque fois qu&#39;ils rejoueront &agrave; la Guerre sauvage, ils feront face &agrave; de nouveaux champions ennemis al&eacute;atoires !</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_north.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_north.jpg" /></a></p>\r\n\r\n<p><br />\r\n<strong>Une Aventure dont vous (et vos compagnons !) &ecirc;tes le h&eacute;ros</strong><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Les Aventures nous permettent de jouer non seulement avec l&#39;histoire, mais aussi avec les m&eacute;canismes de ces zones et nous pouvons donc laisser les joueurs prendre des d&eacute;cisions drastiques sans qu&#39;elles aient un impact sur la &quot;vraie&quot; zone des autres joueurs. Nous avons &eacute;galement la possibilit&eacute; de faire revenir des ennemis d&eacute;j&agrave; vaincus dans le contenu solo ou les transformer en alli&eacute;s.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Dans la plupart des Aventures, votre groupe aura le choix entre diff&eacute;rentes actions &agrave; des endroits divers de l&#39;instance. Essaierez-vous de trouver des armes et de l&#39;&eacute;quipement pour les fermiers Exil&eacute;s opprim&eacute;s par le Dominion ? Ou leur procurerez-vous des vaisseaux de transport pour qu&#39;ils puissent s&#39;enfuir ? Tous les membres de votre groupe pourront voter pour d&eacute;cider de la suite des &eacute;v&eacute;nements.</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_hycrest.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_hycrest.jpg" /></a></p>\r\n\r\n<p><br />\r\n<strong>Votre vocation aura &eacute;galement son r&ocirc;le &agrave; jouer dans les Aventures.</strong><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Avant m&ecirc;me de vous engager sur La piste de Maltombe, par exemple, chaque vocation pourra former un certain pourcentage de la caravane de fa&ccedil;on &agrave; en profiter plus tard. Ainsi, un soldat pourra apprendre &agrave; certains caravaniers &agrave; se battre, afin de pouvoir compter sur eux en cas d&#39;attaque de Plandragons ! Par ailleurs, un explorateur pourra d&eacute;bloquer un passage secret permettant de contourner des pi&egrave;ges, alarmes et autres monstres endormis. Dans chaque Aventure, les diff&eacute;rentes vocations pourront interagir &agrave; leur mani&egrave;re et chacune de leurs d&eacute;cisions leur ouvrira de nouvelles possibilit&eacute;s !</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">C&#39;est tout pour aujourd&#39;hui ! Nous vous en dirons plus la prochaine fois, lorsque nous aborderons en d&eacute;tail l&#39;aventure du Dominion disponible au niveau 15, L&#39;&Eacute;meute sid&eacute;rale.</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><a class="bbc_url" href="http://www.wildstar-online.com/media/uploads/images/article-images/adv_void.jpg" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none;" title="Lien externe"><img alt="Image IPB" src="http://www.wildstar-online.com/media/uploads/images/article-images/adv_void.jpg" /></a></p>\r\n\r\n<p><br />\r\n<br />\r\n<a class="bbc_url" href="http://www.wildstar-online.com/fr/news/que_sont_les_aventures_de_wildstar.php" rel="nofollow external" style="color: rgb(101, 101, 101); text-decoration: none; font-family: ''Droid Sans'', helvetica, arial, sans-serif; font-size: 14px; line-height: 21px;" title="Lien externe">Source</a><span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">&nbsp;</span></p>\r\n', 'PgBrUQKePs_maxresdefault.jpg', 42, 0, 1, 'les-aventures-de-wildstar', 1, 3, 1, '', ''),
(14, 'La fÃªte de demoiselles', '1409652000', '2014', '09', '02', '12:00', '<div class="teaser" style="margin: 0px 0px 30px; padding: 0px; color: rgb(140, 139, 139); font-family: ''Droid Sans'', helvetica, arial, sans-serif; font-size: 14px; line-height: 21px;">Les artisans se d&eacute;cha&icirc;nent pour le concours de poup&eacute;es</div>\r\n\r\n<p style="text-align:center"><img alt="Image IPB" src="http://img.finalfantasyxiv.com/lds/pc/fr/images/special/2014/Little_Ladies_Day/special_header.png?1392968998" /></p>\r\n\r\n<p><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:18px"><strong>La plus belle des poup&eacute;es</strong></span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Le printemps est de retour en &Eacute;orz&eacute;a et Nophica, dans son immense bont&eacute;, a jug&eacute; bon de lui faire don de nombreux et inestimables p&ecirc;chers. Les cit&eacute;s-&Eacute;tats, en ce moment m&ecirc;me par&eacute;es d&#39;un magnifique voile fuchsia, ont vu affluer en masse des jeunes filles d&#39;une beaut&eacute; &eacute;poustouflante dont le comportement convivial ne peut signifier qu&#39;une chose : la f&ecirc;te des demoiselles, ce jour b&eacute;ni o&ugrave; les jeunes filles des quatre coins d&#39;&Eacute;orz&eacute;a sont trait&eacute;es comme des princesses, approche.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Comme toujours, l&#39;&OElig;il de mithril cherche &agrave; en savoir plus sur les coulisses de ce festival, et notamment sur les services offerts par la guilde des orf&egrave;vres. La queue aux portes des Joyaux d&#39;Eshtaime s&#39;&eacute;tend jusqu&#39;&agrave; l&#39;all&eacute;e de rubis alors qu&#39;ils n&#39;ont pourtant aucun accessoire particulier en vente. Quelle mouche a bien pu piquer toutes ces personnes ?</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">La r&eacute;ponse est simple, mes chers lecteurs : cette ann&eacute;e, pour la f&ecirc;te des demoiselles, qui a &eacute;t&eacute; cr&eacute;&eacute;e en l&#39;honneur de la princesse Edvya, la cr&egrave;me des artisans d&#39;&Eacute;orz&eacute;a a &eacute;t&eacute; mise &agrave; profit pour concevoir de d&eacute;licates poup&eacute;es &agrave; l&#39;effigie de la princesse.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Celles-ci seront donc v&ecirc;tues de parures plus magnifiques les unes que les autres, et ce sont les jeunes femmes joyeuses de chaque cit&eacute;-&Eacute;tat qui &eacute;liront leur poup&eacute;e pr&eacute;f&eacute;r&eacute;e parmi toutes les figurines. Le meilleur artisan pourrait bien conna&icirc;tre la richesse et la c&eacute;l&eacute;brit&eacute; vu l&#39;int&eacute;r&ecirc;t suscit&eacute; par le concours. Voil&agrave; la raison pour laquelle la guilde attire autant d&#39;artistes d&eacute;sireux de faire de leur poup&eacute;e la plus esth&eacute;tique des cr&eacute;ations. Pour r&eacute;pondre &agrave; la demande, les orf&egrave;vres des Joyaux d&#39;Eshtaime travaillent d&#39;arrache-pied afin de fournir &agrave; leurs clients perles et tapisseries en tous genres. Mais &agrave; peine les ont-ils termin&eacute;es qu&#39;elles sont d&eacute;j&agrave; vendues.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Les &eacute;tals de l&#39;all&eacute;e de rubis sont remplis de ces marchandises, mais j&#39;imagine que cela ne va pas effrayer les aventuriers ; ces braves gens ne reculent devant rien pour d&eacute;nicher un tr&eacute;sor.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">La f&ecirc;te de cette ann&eacute;e offre une myriade de possibilit&eacute;s et, avec un peu de chance, peut-&ecirc;tre que votre poup&eacute;e sera &eacute;lue la plus belle de toutes.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Havak Alvak</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<em>La disparition de la princesse Edvya</em><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Il y a trois si&egrave;cles, Ul&#39;dah &eacute;tait dirig&eacute;e par un sultan &agrave; la poigne de fer : Baldric Thorne, un homme craint dans toute la r&eacute;gion pour ses acc&egrave;s de col&egrave;re soudains et sa rapidit&eacute; &agrave; faire justice. Les Douze jug&egrave;rent bon de donner au sultan une fille unique, Edvya, qu&#39;il aimait bien plus que le soleil et la lune. Et c&#39;est cet amour inconditionnel qui poussa Baldric &agrave; s&#39;assurer que rien ni personne ne pourrait faire du mal &agrave; sa fille ador&eacute;e. Il lui interdit donc de quitter le palais royal et la pla&ccedil;a m&ecirc;me sous la surveillance d&#39;un cort&egrave;ge de plus de cinquante servantes et s&eacute;n&eacute;chaux.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Mais l&#39;envie de d&eacute;couvrir le monde &eacute;tait si forte, qu&#39;un jour, la princesse demanda &agrave; la fille d&#39;un meunier, venue au palais avec sa m&egrave;re livrer de la farine aux cuisines, de lui pr&ecirc;ter ses v&ecirc;tements. Sans sa tiare et sa somptueuse robe, &eacute;chapper &agrave; la vigilance des gardes n&#39;&eacute;tait plus qu&#39;une formalit&eacute;. Cependant, le sultan ne mit pas longtemps &agrave; comprendre que quelque chose ne tournait pas rond et, d&eacute;couvrant que sa fille avait disparu, sombra dans une rage profonde. Il lanca toute l&#39;arm&eacute;e du sultanat &agrave; la recherche de la princesse. Pensant qu&#39;Edvya avait &eacute;t&eacute; enlev&eacute;e par la famille du meunier, le sultan fit mettre &agrave; sac leur demeure. Il les fit ensuite arr&ecirc;ter, torturer, et jeter aux oubliettes.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Heureusement, la princesse ne s&#39;&eacute;tait pas aventur&eacute;e bien loin et fut rapidement retrouv&eacute;e par les hommes de son p&egrave;re dans un march&eacute;, tout pr&egrave;s d&#39;Ul&#39;dah. Une fois en s&eacute;curit&eacute; dans l&#39;enceinte du palais, Edvya raconta toute l&#39;histoire &agrave; son p&egrave;re, lui expliquant que c&#39;est elle qui avait forc&eacute; la jeune fille &agrave; l&#39;aider et le suppliant de se montrer cl&eacute;ment avec sa famille. R&eacute;alisant que ses prisonniers &eacute;taient innocents, il les fit lib&eacute;rer et convoquer. Non seulement il leur pr&eacute;senta ses plus plates excuses, mais il demanda &eacute;galement aux architectes royaux de leur fabriquer une nouvelle maison. Enfin, contre toute attente, Baldric proposa &agrave; la fille du meunier d&#39;&ecirc;tre son s&eacute;n&eacute;chal pour un jour car, pour lui, toutes les jeunes filles du sultanat, nobles ou non, devaient recevoir le respect qui leur &eacute;tait d&ucirc;.</span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Il ne fallut pas longtemps pour que cette d&eacute;monstration d&#39;humilit&eacute; se r&eacute;pande dans tout Ul&#39;dah. Les habitants appr&eacute;ci&egrave;rent le geste de leur souverain et commenc&egrave;rent &agrave; le voir autrement que comme un despote au c&oelig;ur de pierre. Le sultan d&eacute;cida m&ecirc;me de consacrer une journ&eacute;e par an &agrave; l&#39;&eacute;lection d&#39;une jeune fille ordinaire pour laquelle il jouerait les s&eacute;n&eacute;chaux, comme il l&#39;avait fait avec la fille du meunier.</span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><img alt="Image IPB" src="http://img11.hostingpics.net/pics/153468Fete2.jpg" /></p>\r\n\r\n<p><br />\r\n<br />\r\n<em>Dates des festivit&eacute;s</em><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Du vendredi 28 f&eacute;vrier 2014 &agrave; 8 heures au jeudi 13 mars 2014 &agrave; 14h59 (GMT).</span><br />\r\n<br />\r\n<br />\r\n<em>D&eacute;roulement</em><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Toujours pr&ecirc;ts &agrave; servir les jeunes filles d&#39;&Eacute;orz&eacute;a, les s&eacute;n&eacute;chaux royaux veillant au bon d&eacute;roulement de l&#39;&eacute;v&eacute;nement seront pr&eacute;sents dans les trois cit&eacute;s-&Eacute;tats pour s&#39;assurer que tous pourront participer aux festivit&eacute;s de cette ann&eacute;e.</span><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">* Cette s&eacute;rie de qu&ecirc;tes ne peut &ecirc;tre effectu&eacute;e que pendant la dur&eacute;e de l&#39;&eacute;v&eacute;nement.</span><br />\r\n<br />\r\n<em>Emplacements des s&eacute;n&eacute;chaux royaux</em><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Le Tillac, Limsa Lominsa</span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><img alt="Image IPB" src="http://img.finalfantasyxiv.com/lds/pc/global/images/special/2014/Little_Ladies_Day/map_01.png?%20%201392968998" /></p>\r\n\r\n<p><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Vieille Gridania</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><img alt="Image IPB" src="http://img.finalfantasyxiv.com/lds/pc/global/images/special/2014/Little_Ladies_Day/map_02.png?%20%201392968998" /></p>\r\n\r\n<p><br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">Faubourg de Nald, Ul&#39;dah</span><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align:center"><img alt="Image IPB" src="http://img.finalfantasyxiv.com/lds/pc/global/images/special/2014/Little_Ladies_Day/map_03.png?%20%201392968998" /></p>\r\n\r\n<p><br />\r\n<br />\r\n<em>Objets sp&eacute;ciaux</em><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px"><img alt="Image IPB" src="http://img11.hostingpics.net/pics/289088Fete3.jpg" /></span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px"><img alt="Image IPB" src="http://img11.hostingpics.net/pics/470542Fete4.jpg" /></span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px"><img alt="Image IPB" src="http://img11.hostingpics.net/pics/153122Fete5.jpg" /></span><br />\r\n<br />\r\n<span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px"><img alt="Image IPB" src="http://img11.hostingpics.net/pics/126040Fete6.jpg" /></span><span style="color:rgb(140, 139, 139); font-family:droid sans,helvetica,arial,sans-serif; font-size:14px">&nbsp;</span></p>\r\n\r\n<div class="ipsLikeBar right clearfix" id="rep_post_96" style="margin: 10px 0px; padding: 0px; float: right; font-size: 11px; color: rgb(140, 139, 139); font-family: ''Droid Sans'', helvetica, arial, sans-serif;">\r\n<ul>\r\n	<li><a class="ipsLikeButton ipsLikeButton_enabled rep_up" href="http://www.lancea-online.com/index.php?app=core&amp;module=global&amp;section=reputation&amp;do=add_rating&amp;app_rate=ccs&amp;type=record_id_1&amp;type_id=96&amp;rating=1&amp;secure_key=9f7afcd07f5cfd98cc728283788cba34&amp;post_return=96" style="color: rgb(207, 207, 207); text-decoration: none; line-height: 20px; padding: 0px 6px 0px 24px; display: inline-block; border-top-left-radius: 10px; border-top-right-radius: 10px; border-bottom-right-radius: 10px; border-bottom-left-radius: 10px; -webkit-box-shadow: rgba(64, 66, 73, 0.721569) -1px 12px 37px 0px inset; box-shadow: rgba(64, 66, 73, 0.721569) -1px 12px 37px 0px inset; background-image: url(http://www.lancea-online.com/public/style_images/LanceA_5_0/like_button.png); background-color: rgb(123, 150, 187); border: 1px solid rgb(33, 33, 33); z-index: 10 !important; background-position: 0% 0%; background-repeat: no-repeat no-repeat;" title="Jâ€™aime cet Ã©lÃ©ment">J&rsquo;aime</a></li>\r\n	<li>\r\n	<div>&nbsp;</div>\r\n	</li>\r\n</ul>\r\n</div>\r\n', '1aWW4vmizH_178369Fete1.jpg', 38, 0, 1, 'la-fete-de-demoiselles', 1, 3, 1, '', ''),
(27, 'World of Warcraft : CafÃ© avec les devs : soigner (littÃ©ralement !) les mÃ©canismes de jeu', '1401881400', '2014', '06', '04', '13:30', '<p>La semaine derni&egrave;re, nous vous avons parl&eacute; de certains de nos objectifs pour le d&eacute;veloppement de&nbsp;<em>World of Warcraft: Warlords of Draenor</em>, &agrave; savoir l&rsquo;&eacute;quilibrage des caract&eacute;ristiques et la simplification d&rsquo;&eacute;l&eacute;ments inutilement complexes. Nous allons aujourd&rsquo;hui &eacute;voquer diff&eacute;rents points li&eacute;s &agrave; un &eacute;l&eacute;ment vital du jeu : la sant&eacute;.<br />\r\n&nbsp;</p>\r\n\r\n<h1>Sant&eacute; et r&eacute;silience</h1>\r\n\r\n<p>Dans la prochaine extension, nous comptons int&eacute;grer plusieurs modifications &eacute;troitement li&eacute;es et destin&eacute;es &agrave; am&eacute;liorer les m&eacute;canismes de jeu des soigneurs, ainsi que la dynamique des soins prodigu&eacute;s en JcJ.<br />\r\n<br />\r\nActuellement, du fait des grandes quantit&eacute;s de r&eacute;silience de base et de traumatophobie pr&eacute;sentes dans Mists of Pandaria, les personnages-joueurs s&rsquo;av&egrave;rent bien plus faibles en JcJ qu&rsquo;en JcE. Nous avons l&rsquo;intention de r&eacute;duire le plus possible cet &eacute;cart dans Warlords of Draenor. Afin de limiter la d&eacute;pendance &agrave; la r&eacute;silience, il &eacute;tait n&eacute;cessaire d&rsquo;accro&icirc;tre la capacit&eacute; de survie des personnages face aux autres joueurs, ce que nous avons r&eacute;ussi &agrave; faire en doublant (apr&egrave;s &eacute;quilibrage des caract&eacute;ristiques) leurs points de vie.</p>\r\n\r\n<p style="text-align:center"><img alt="" height="240" src="https://bnetcmsus-a.akamaihd.net/cms/blog_header/36YD2TF9LPDC1289526676771.jpg" width="622" /></p>\r\n\r\n<p>Prise seule, cette augmentation aurait permis au personnage-joueur de survivre bien plus facilement dans le monde en g&eacute;n&eacute;ral. Pour contrebalancer cet effet, nous avons donc accru les d&eacute;g&acirc;ts inflig&eacute;s par les cr&eacute;atures tout en amplifiant l&rsquo;efficacit&eacute; des sorts de soin. Cons&eacute;quence de ces ajustements, les attaques individuelles en JcJ r&eacute;duisent d&eacute;sormais les points de vie du personnage dans une moindre mesure, mais sa capacit&eacute; de survie en JcE n&rsquo;en est pas affect&eacute;e.<br />\r\n<br />\r\nLa multiplication du nombre de points de vie nous a permis de r&eacute;duire la r&eacute;silience et la traumatophobie, mais nous cherchions de fait &agrave; les &eacute;liminer compl&egrave;tement. Pour ce faire, nous avons &eacute;galement mod&eacute;r&eacute; les pics de d&eacute;g&acirc;ts en JcJ en r&eacute;duisant les effets critiques des d&eacute;g&acirc;ts critiques et des soins critiques de 200 % &agrave; 150 % de leur effet normal.<br />\r\n<br />\r\nNous esp&eacute;rons que ces modifications permettront de supprimer enti&egrave;rement la r&eacute;silience de base et la traumatophobie. Comme il reste n&eacute;anmoins possible qu&rsquo;une petite quantit&eacute; de r&eacute;silience de base et/ou de traumatophobie soit n&eacute;cessaire, nous ne manquerons pas de tester ces changements en profondeur afin d&rsquo;y apporter des ajustements.</p>\r\n\r\n<h1>Ajustement des sorts de soin</h1>\r\n\r\n<p>Dans Warlords of Draenor, l&rsquo;un de nos objectifs en mati&egrave;re de soins est de limiter les points de vie restaur&eacute;s par les soigneurs par rapport au total de points de vie de la cible. Actuellement, le pourcentage de points de vie restaur&eacute; par un soin, quel qu&rsquo;il soit, augmente consid&eacute;rablement &agrave; mesure que l&rsquo;&eacute;quipement des soigneurs et de leurs alli&eacute;s se perfectionne. Les soigneurs deviennent alors capables de restaurer les barres de sant&eacute; si rapidement que nous sommes oblig&eacute;s d&rsquo;amplifier sans cesse les pics de d&eacute;g&acirc;ts. Dans l&rsquo;id&eacute;al, nous voudrions que les personnages-joueurs puissent &eacute;voluer avec une fraction de leurs points de vie totaux, sans que les soigneurs qui en sont responsables aient l&rsquo;impression qu&rsquo;ils risquent de passer l&rsquo;arme &agrave; gauche &agrave; tout moment. Nous pensons que le jeu serait plus vari&eacute; et int&eacute;ressant pour les soigneurs, et leur permettrait d&rsquo;exploiter pleinement toute la palette de leurs comp&eacute;tences, si leurs alli&eacute;s passaient plus de temps entre 0 % et 100 % de points de vie, au lieu voir leur sant&eacute; diminuer dangereusement &agrave; la moindre attaque, obligeant les soigneurs &agrave; se pr&eacute;cipiter pour les restaurer &agrave; 100 % au plus vite.</p>\r\n\r\n<p style="text-align:center"><img alt="" height="240" src="https://bnetcmsus-a.akamaihd.net/cms/blog_header/IGTB5UYIQJ2G1337383565232.jpg" width="622" /></p>\r\n\r\n<p>Dans cet objectif, nous avons moins augment&eacute; les points de vie restaur&eacute;s par les soins que les d&eacute;g&acirc;ts inflig&eacute;s par les cr&eacute;atures. Les sorts de soin sont ainsi d&eacute;lib&eacute;r&eacute;ment moins puissants, par rapport &agrave; la r&eacute;serve totale de points de vie, qu&rsquo;avant l&rsquo;&eacute;quilibrage des caract&eacute;ristiques. En outre, &agrave; mesure que l&rsquo;&eacute;quipement est optimis&eacute;, points de vie et sorts de soins sont d&eacute;sormais am&eacute;lior&eacute;s de fa&ccedil;on proportionnelle, de sorte qu&rsquo;un sort de soins ne puisse plus avoir une efficacit&eacute; d&eacute;mesur&eacute;e. Pas d&rsquo;inqui&eacute;tude cependant en ce qui concerne les raids : tous ces changements seront pris en consid&eacute;ration dans le d&eacute;veloppement du contenu de raid de Warlords of Draenor.<br />\r\n<br />\r\n&Agrave; noter &eacute;galement que les sorts de soins dont l&rsquo;effet d&eacute;pend d&rsquo;un pourcentage de la r&eacute;serve maximum de points de vie ont nettement &eacute;t&eacute; am&eacute;lior&eacute;s par l&rsquo;augmentation massive de ladite r&eacute;serve. Nous avons donc r&eacute;duit leurs pourcentages en cons&eacute;quence. Malgr&eacute; cette diminution de leur effet, ces sorts de soins particuliers conservent &agrave; peu de chose pr&egrave;s leur efficacit&eacute;, ce qui n&rsquo;est pas forc&eacute;ment le cas d&rsquo;autres sorts de soin.<br />\r\n<br />\r\nToutes ces modifications s&rsquo;appliquent &eacute;galement aux boucliers absorbant les d&eacute;g&acirc;ts. En outre, nous r&eacute;duisons la puissance des effets d&rsquo;absorption en g&eacute;n&eacute;ral. De fait, lorsqu&rsquo;ils deviennent trop puissants, ces effets sont souvent utilis&eacute;s &agrave; la place des sorts de soins et non plus en compl&eacute;ment. Bien entendu, ces changements seront pris en consid&eacute;ration lors de l&rsquo;ajustement des sp&eacute;cialisations d&eacute;pendant des effets d&rsquo;absorption, comme les pr&ecirc;tres Discipline.<br />\r\n<br />\r\nNous nous sommes &eacute;galement pench&eacute;s sur les sorts de soin passifs ou &agrave; ciblage automatique (&eacute;galement appel&eacute;s soins &laquo; intelligents &raquo;). Nous voulons que les soigneurs choisissent les personnages qu&rsquo;ils aident et les sorts qu&rsquo;ils utilisent en connaissance de cause ; cela ne rendra le jeu que plus interactif et plus amusant. Dans ce but, nous avons r&eacute;duit l&rsquo;effet d&rsquo;un certain nombre de sorts de soin passifs et &agrave; vis&eacute;e automatique, afin que ces soins soient un peu moins intelligents. D&eacute;sormais, ceux-ci choisiront al&eacute;atoirement une cible bless&eacute;e dans leur zone d&rsquo;effet au lieu de s&eacute;lectionner syst&eacute;matiquement le personnage ayant perdu le plus de points de vie. Bien entendu, la priorit&eacute; sera toujours accord&eacute;e aux personnages plut&ocirc;t qu&rsquo;aux familiers.<br />\r\n<br />\r\nUn autre de nos objectifs pour les sorts de soin dans cette extension est de parvenir &agrave; un meilleur &eacute;quilibre entre sorts &agrave; vis&eacute;e unique et sorts &agrave; vis&eacute;e multiple. Nous avons attentivement &eacute;tudi&eacute; le co&ucirc;t en mana des sorts permettant de soigner plusieurs cibles et, dans de nombreux cas, nous avons limit&eacute; leur efficacit&eacute; en diminuant, notamment, la quantit&eacute; de points restaur&eacute;e. Nous avons parfois d&eacute;cid&eacute; d&rsquo;en augmenter le co&ucirc;t de mana, solution plus judicieuse dans quelques rares cas. Bien s&ucirc;r, nous voulons que les joueurs utilisent les sorts de soin &agrave; vis&eacute;e multiple, mais ceux-ci ne doivent &ecirc;tre sup&eacute;rieurs &agrave; leurs &eacute;quivalents &agrave; vis&eacute;e unique que lorsqu&rsquo;ils permettent de soigner plus de deux personnages-joueurs sans g&eacute;n&eacute;rer de surplus de soins. De cette fa&ccedil;on, le joueur doit alors un choix et l&rsquo;int&eacute;r&ecirc;t de privil&eacute;gier un sort &agrave; vis&eacute;e unique ou un sort &agrave; vis&eacute;e multiple d&eacute;pendra de la situation.<br />\r\n<br />\r\nEnfin, nous avons supprim&eacute; les sorts de soin r&eacute;g&eacute;n&eacute;rant une moindre quantit&eacute; de points de vie et ayant un faible co&ucirc;t en mana, comme Nourrir, Lumi&egrave;re sacr&eacute;e et Vague de soins. Nous estimons en effet que ces sorts compliquent les m&eacute;canismes de jeu des soigneurs sans v&eacute;ritablement y apporter de profondeur (nous avons &eacute;galement renomm&eacute; certains sorts pour pouvoir r&eacute;utiliser ces noms : ainsi, Vague de soins sup&eacute;rieurs s&rsquo;appelle d&eacute;sormais Vague de soins). Toutefois, nous tenons &agrave; ce que les soigneurs ne perdent pas de vue leur r&eacute;serve de mana lorsqu&rsquo;ils d&eacute;cident de lancer un sort. Nous avons donc modifi&eacute; le co&ucirc;t en mana et les points de vie restaur&eacute;s de nombreux sorts afin que les joueurs aient &agrave; choisir entre sorts &agrave; faible restauration et faible co&ucirc;t de mana, d&rsquo;une part, et sorts &agrave; haute restauration et co&ucirc;t de mana &eacute;lev&eacute;, d&rsquo;autre part. La liste suivante r&eacute;pertorie certains des sorts concern&eacute;s pour chacune des classes de soigneurs :<br />\r\n<br />\r\n<strong>Druides, efficacit&eacute; maximale :</strong>&nbsp;Toucher gu&eacute;risseur, R&eacute;cup&eacute;ration, Efflorescence<br />\r\n<strong>Druides, restauration maximale :</strong>&nbsp;R&eacute;tablissement, Croissance sauvage<br />\r\n<br />\r\n<strong>Moines, efficacit&eacute; maximale :</strong>&nbsp;Brume apaisante, Brume de r&eacute;novation<br />\r\n<strong>Moines, restauration maximale :</strong>&nbsp;D&eacute;ferlante de brume, Coup tournoyant de la grue<br />\r\n<br />\r\n<strong>Paladins, efficacit&eacute; maximale :</strong>&nbsp;Lumi&egrave;re sacr&eacute;e, Horion sacr&eacute;, Mot de gloire, Lumi&egrave;re de l&rsquo;aube<br />\r\n<strong>Paladins, restauration maximale :</strong>&nbsp;&Eacute;clair lumineux, Radiance sacr&eacute;e<br />\r\n<br />\r\n<strong>Pr&ecirc;tres, efficacit&eacute; maximale :</strong>&nbsp;Soins sup&eacute;rieurs, Cercle de soins, Pri&egrave;re de gu&eacute;rison, Nova sacr&eacute;e (nouvelle version, r&eacute;serv&eacute;e &agrave; la sp&eacute;cialisation Discipline), P&eacute;nitence<br />\r\n<strong>Pr&ecirc;tres, restauration maximale :</strong>&nbsp;Soins rapides, Pri&egrave;re de soins<br />\r\n<br />\r\n<strong>Chamans, efficacit&eacute; maximale :</strong>&nbsp;Vague de soins, Remous, Pluie gu&eacute;risseuse<br />\r\n<strong>Chamans, restauration maximale :</strong>&nbsp;Afflux de soins, Salve de gu&eacute;rison</p>\r\n\r\n<p>Cette discussion sur l&rsquo;efficacit&eacute; risque d&rsquo;inqui&eacute;ter nombre de soigneurs quant &agrave; la r&eacute;g&eacute;n&eacute;ration de mana et leur r&eacute;serve de mana. Inutile de vous alarmer, cependant. Nous avons nettement augment&eacute; la quantit&eacute; de mana restaur&eacute;e pour les premiers niveaux d&rsquo;&eacute;quipement, ce qui nous a permis de moins l&rsquo;accro&icirc;tre pour les &eacute;quipements plus sophistiqu&eacute;s. Gr&acirc;ce &agrave; cet ajustement, toutes les modifications &eacute;voqu&eacute;es plus haut s&rsquo;adaptent parfaitement &agrave; tous les niveaux de jeu, m&ecirc;me dans les contenus les plus faciles, comme les donjons h&eacute;ro&iuml;ques ou le premier niveau de raid. Elles s&rsquo;accordent aussi id&eacute;alement au dernier niveau de raid, pour lequel l&rsquo;efficacit&eacute; et le mana n&rsquo;avaient plus d&rsquo;importance, du fait de taux de r&eacute;g&eacute;n&eacute;ration trop &eacute;lev&eacute;s.<br />\r\n<br />\r\nLes soigneurs devront assimiler un certain nombre de nouveaut&eacute;s dans cette extension : restauration r&eacute;duite, cibles prioritaires, sorts de soin moins &laquo; intelligents &raquo;, effets d&rsquo;absorption plus faibles et importance accrue de leurs propres d&eacute;cisions. Nous sommes convaincus d&rsquo;avoir su tirer les le&ccedil;ons des pr&eacute;c&eacute;dentes extensions afin d&rsquo;offrir aujourd&rsquo;hui aux soigneurs l&rsquo;exp&eacute;rience la plus aboutie &agrave; ce jour. Gr&acirc;ce &agrave; ces modifications, leurs m&eacute;canismes de jeu devraient &ecirc;tre plus dynamiques, plus int&eacute;ressants, moins intransigeants et, n&rsquo;ayons pas peur de le dire, bien plus amusants !<br />\r\n&nbsp;</p>\r\n\r\n<h1>Sorts de soin &agrave; lancement instantan&eacute;</h1>\r\n\r\n<p style="text-align:center"><img alt="" height="240" src="https://bnetcmsus-a.akamaihd.net/cms/blog_header/VMVT7K47QQV21290186699192.jpg" width="622" /></p>\r\n\r\n<p>Avec le temps, les soigneurs ont acquis un vaste arsenal de sorts de soin pouvant &ecirc;tre lanc&eacute;s en se d&eacute;pla&ccedil;ant, ce qui en annule le co&ucirc;t li&eacute; au d&eacute;placement pr&eacute;vu et limite la capacit&eacute; &agrave; contrer les soins en JcJ. Ne restent donc que les effets de silence et le contr&ocirc;le des foules (que nous essayons de mod&eacute;rer, voir l&rsquo;article&nbsp;<a href="http://eu.battle.net/wow/fr/blog/13107743/" style="outline: none; text-decoration: none; color: rgb(255, 177, 0);" target="_blank">Ratiboiser et &eacute;laguer les jardins de la guerre</a>) pour limiter les effets de soin d&rsquo;un personnage-joueur ennemi. Nous n&rsquo;allons pas pour autant supprimer la possibilit&eacute; de lancer des soins instantan&eacute;s, mais t&acirc;chons de limiter les techniques correspondantes. En voici quelques exemples :<br />\r\n<br />\r\n<strong>Druide</strong></p>\r\n\r\n<ul style="list-style-type:none">\r\n	<li>Croissance sauvage (Restauration) a d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde.</li>\r\n</ul>\r\n\r\n<p><strong>Moine</strong></p>\r\n\r\n<ul style="list-style-type:none">\r\n	<li>&Eacute;l&eacute;vation (Tisse-brume) a d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde.</li>\r\n</ul>\r\n\r\n<p><strong>Paladin</strong></p>\r\n\r\n<ul style="list-style-type:none">\r\n	<li>Flamme &eacute;ternelle et Mot de gloire ont d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde avec la sp&eacute;cialisation Sacr&eacute;.</li>\r\n	<li>Lumi&egrave;re de l&rsquo;aube a d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde.</li>\r\n</ul>\r\n\r\n<p><strong>Pr&ecirc;tre</strong></p>\r\n\r\n<ul style="list-style-type:none">\r\n	<li>Escalade, &Eacute;toile divine et Halo ont d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde.</li>\r\n	<li>Pri&egrave;re de gu&eacute;rison a d&eacute;sormais une dur&eacute;e d&rsquo;incantation de 1,5 seconde.</li>\r\n</ul>\r\n\r\n<p>Toutes ces modifications ont pour but d&rsquo;harmoniser les m&eacute;canismes de jeu entre JcE et JcJ et de les rendre plus dynamiques pour les soigneurs.</p>\r\n\r\n<p>Elles ne repr&eacute;sentent pourtant qu&rsquo;une partie des changements que vous d&eacute;couvrirez tout au long de cette phase de d&eacute;veloppement. Nous esp&eacute;rons que gr&acirc;ce &agrave; toutes les informations que nous partageons avec vous ici, sur le site officiel, sur les forums et via Twitter, vous aurez un meilleur aper&ccedil;u de ce qui vous attend dans Warlords of Draenor et de la direction que nous souhaitons faire prendre. Ce que nous vous avons d&eacute;voil&eacute; jusqu&rsquo;ici n&rsquo;est que la partie &eacute;merg&eacute;e de l&rsquo;iceberg ! Mais comme toujours, n&rsquo;oubliez pas que tout peut encore changer au cours de la phase de test. Nous attendons vos commentaires avec impatience !</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Source : <a href="http://eu.battle.net/wow/fr/blog/13183878/caf%C3%A9-avec-les-devs-soigner-litt%C3%A9ralement-les-m%C3%A9canismes-de-jeu-07-03-2014">Blizzard Entertainment</a></em></p>\r\n\r\n<p><em>Merci &agrave; Enyael pour la proposition de News.</em></p>\r\n', 'fgKYFsMlXV_shapka82.jpg', 36, 0, 1, 'world-of-warcraft-cafe-avec-les-devs-soigner-litteralement-les-mecanismes-de-jeu', 1, 2, 1, '', ''),
(72, 'En bref : Le FreeSync d''AMD, adoptÃ© par la VESA ?', '1409650200', '2014', '09', '02', '11:30', '<p>AMD semble avancer sur la question du FreeSync, le groupe VESA, pour Video Electronics Standards Association a annonc&eacute; l&#39;adoption future du protocole d&#39;AMD. Ce protocole serait une concurrence directe au G-Sync de Nvidia, d&#39;autant plus int&eacute;ressante que cette solution serait indolore pour le consommateur, entendez par l&agrave; que cela ne se traduirait pas par une nouvelle facture, il s&#39;agirait simplement d&#39;une modification apport&eacute;e dans les pilotes AMD et d&#39;un support dudit protocole par les constructeurs d&#39;&eacute;cran, d&#39;o&ugrave; l&#39;&eacute;tape importante de l&#39;aval de la VESA.</p>\r\n\r\n<p>Ce protocole serait nativement reconnu par la norme DisplayPort 1.2a, seul b&eacute;mol, pour que tout se combine &agrave; merveille, il faut que les constructeurs d&#39;&eacute;cran d&eacute;cident de soutenir ce nouveau protocole.<br />\r\nAffaire &agrave; suivre donc.</p>\r\n\r\n<p>source : <a href="http://www.guru3d.com/news_story/amd_freesync_will_be_adopted_by_vesa.html" rel="nofollow" target="new" title="Guru 3D">Guru 3D</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'en-bref-le-freesync-d-amd-adopte-par-la-vesa-yvb5SGB8jy.jpg', 95, 0, 1, 'en-bref-le-freesync-d-amd-adopte-par-la-vesa', 1, 2, 1, '<p>Commentaire du correcteur</p>\r\n', 'Keridian'),
(68, 'The Elder Scrolls Online: LanceA est en marche !', '1409563800', '2014', '09', '01', '11:30', '<p style="text-align:center"><em>Le ciel s&#39;est assombri, cher ami.</em></p>\r\n\r\n<p style="text-align:center"><em>Je le ressens depuis la veille, la rage en moi ne fait qu&#39;augmenter.<br />\r\nJ&#39;ai aff&ucirc;t&eacute; ma lame, poli mon armure, car je le sais l&#39;heure est venu.</em></p>\r\n\r\n<p style="text-align:center"><em>Je pars ce soir pour rejoindre les miens, LanceA est d&eacute;ja en marche.<br />\r\nNous d&eacute;fendrons nos biens et nos valeurs.</em></p>\r\n\r\n<p style="text-align:center"><img alt="" height="428" src="http://img15.hostingpics.net/pics/936528Sanstitre.png" width="640" /></p>\r\n\r\n<p style="text-align:center">&nbsp;</p>\r\n\r\n<p style="text-align:center"><em>Nul n&#39;oubliera les cris de souffrances de nos ennemis,</em></p>\r\n\r\n<p style="text-align:center"><em>Nul n&#39;oubliera la force de nos guerriers,</em></p>\r\n\r\n<p style="text-align:center"><em>Nul n&#39;oubliera la puissance de nos mages.</em></p>\r\n\r\n<p style="text-align:center"><em>Mais souviens toi &agrave; jamais : le tr&ocirc;ne est &agrave; nous !</em></p>\r\n\r\n<p style="text-align:center"><img alt="" height="274" src="http://img15.hostingpics.net/pics/3600779602.png" width="640" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<em>Merci &agrave; Brolak pour la proposition de News!</em></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'the-elder-scrolls-online-lancea-est-en-marche-cIVgvU4bBF.jpg', 142, 1, 1, 'the-elder-scrolls-online-lancea-est-en-marche', 1, 1, 1, '<p>Commentaire du correcteur</p>\r\n', 'Keridian');
