(1, 'Agone', '1f3718968c3fdd9d7508e5be57bd3783', 0, '<p><em>Je m&#39;appelle Alexis et j&#39;ai 27ans. Je suis originaire de Lorraine, mais j&#39;habite d&eacute;sormais &agrave; c&ocirc;t&eacute; de Strasbourg, en Alsace. Je travaille dans une soci&eacute;t&eacute; de service en Informatique en tant qu&#39;ing&eacute;nieur en d&eacute;veloppement web. Je suis aussi p&egrave;re de famille ce qui occupe quelques soir&eacute;es et week-ends.Sinon je suis un passionn&eacute; de jeux-vid&eacute;o, je suis n&eacute; dedans. Avec tout d&#39;abord un commodor, ensuite un Amiga, enfin un bon vieux PC. Mon premier jeu en ligne : Vietcong. Je suis pass&eacute; ensuite sur CoD et toute la s&eacute;rie qui a suivi jusque CoD4. Apr&egrave;s, je suis arriv&eacute; dans l&#39;univers des MMORPG, avec World of Warcraft. J&#39;y ai jou&eacute; jusqu&#39;&agrave; la sortie de Cataclysme. J&#39;ai aussi fait quelques apparitions sur WAR, AoC, Aion ou Allods. Derni&egrave;rement, je suis pass&eacute; sur Guilde-wars 2 et TERA mais ces deux derniers m&#39;ont assez vite lass&eacute;. En ce moment je suis sur Neverwinter o&ugrave; je joue avec quelques amis, en attendant de meilleurs jeux.</em></p>\r\n', 'tristabeaua', '', '', 'www.lancea-online.com', '', '|S86l', 'agone@lancea-online.com', 1, '', '', 3),
